import { useEffect, useState } from 'react';
import axios from "./api/axios"
import './App.css';

function App() {
  const [posts, setPosts] = useState([])

  useEffect(() => {
    axios.get("/posts?_limit=5").then((res) => {
      setPosts(res.data)
    })
  }, [])

  return (
    <div className="App"></div>
  );
}

export default App;
